import React from "react";
import { Link } from "react-router-dom";
import { Container, Typography, Button } from "@mui/material";
import cursorImage from "../../assets/images/arrow.png";
import LandscapeOverlay from "../../components/LandscapeOverlay";

const HomePage = () => {
  return (
    <div className="min-h-screen flex flex-col justify-center items-center text-center text-white p-5 bg-transparent relative">
      <div className="absolute inset-0 z-[-1]">
        {" "}
        {/* Ensure it's behind the content */}
        <LandscapeOverlay />
      </div>
      <div className="z-10">
        <img src={cursorImage} alt="Cursor" className="floating-cursor" />
        <h1 className="text-6xl mb-3">
          <Link to="/about-me" className="text-white no-underline">
            Anthony Mercadante
          </Link>
        </h1>
        <p className="max-w-prose mb-5">
          I'm a full-stack software developer. Here you can find my portfolio, a
          small glimpse of recently worked on projects using various programming
          languages.
        </p>
        <Link
          to="/portfolio"
          className="inline-block bg-dark-gray-500 text-white py-2 px-4 rounded transition duration-300 ease-in-out hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-700 focus:ring-opacity-50"
        >
          View My Work
        </Link>
      </div>
    </div>
  );
};

export default HomePage;
